import FirebaseAuth from '../components/FirebaseAuth'
import Layout from '../components/Layout';

const Auth = () => {
    return (
        <div>
            <Layout>
                <div className="centerLayout">
                    <h2>Sign in with an existing account, or sign up.</h2>
                    <FirebaseAuth />
                </div>
            </Layout>
        </div>
    )
}

export default Auth
